import React from 'react';
import Featured from '../../component/Featured/Featured';
import requests from '../../requests';
import './Browse.scss';

function Browse() {
	return (
		<div className="app">
			<h1>Browse</h1>
			<Featured title='NETFLIX ORIGINALS' fetchUrl={requests.fetchNetflixOriginals} />
			<Featured title='Tranding Now' fetchUrl={requests.fetchTrending} />
		</div>
	);
}

export default Browse;
